import React from 'react';
import './App.css';

class ForecastTwo extends React.Component {
    constructor(props) {
        super(props);
    }

    render(){
        const day="Fri";
        const high="19 c";
        const low="8 c";
        return(
            <div>
                <div className="weather-forecast__row">
                <span className="weather-forecast__day">{day}</span>
                <span className="weather-forecast__icon">
                    <i className="fa fa-clock-o">
                        {
                            this.props.clocks.map(item =>{
                                return(
                                    < ForecastTwo key={item.clocks}/>
                                )
                            })
                        }
                    </i> 
                </span>
                <span className="weather-forecast__high">{high}</span>
                <span className="weather-forecast__low">{low}</span>
                </div>
            </div>
        );
    }
}

export default ForecastTwo;
